import React from 'react'
export default function App() {
    function handleSubmit(e) {
        e.preventDefault();
        console.log('You clicked submit.');
        }
        return (
        //arrow function
        <form onSubmit={(event)=>handleSubmit(event)}>
        <button type="submit">Submit</button>
        </form>
    )
}
